//SVG启动时自动执行此方法
function startup(evt){
	O=evt.target;
	Doc=O.ownerDocument	;
	SVGRoot = Doc.documentElement;

	//下列SVG中定义的JS方法将在上级HTML页面中调用
	parentWindow = window.parent;
	parentWindow.deviceIDs=deviceIDs;
	parentWindow.setTitle = setTitle;
	parentWindow.setDisplayTime = setDisplayTime;
	parentWindow.startBusBlink=startBusBlink;
	parentWindow.stopBusBlink=stopBusBlink;
        parentWindow.startAlarmBlink=startAlarmBlink;
	//parentWindow.setBusIValues=setBusIValues;
	//parentWindow.setBusValues = setBusValues;
	parentWindow.setIValues = setIValues;   	//设置显示电流
        parentWindow.startBlink = startBlink;
	parentWindow.stopBlink = stopBlink;
        parentWindow.setUValues = setUValues;		//设置显示电压值
	//parentWindow.setCapacityStatus = setCapacityStatus;
	//O.setAttribute('onmouseup','Boo=T(Boo);')
	//O.pauseAnimations()
	parentWindow.busLineDeviceID=busLineDeviceID; 
	parentWindow.highVoltageDeviceID=highVoltageDeviceID;
	parentWindow.setOpen=setOpen;
	parentWindow.setClose=setClose;
	parentWindow.setAllClose=setAllClose;
}
//开关显示控制
function setOpen(Id){
      var animation = document.getElementById('openblank'+Id);
      if(animation!=null) {	
		animation.setAttributeNS(null, 'values','1');
		animation.beginElement();
     }
	 var animation1 = document.getElementById('closeblank'+Id);
      if(animation1!=null) {	
		animation1.setAttributeNS(null, 'values','0');
		animation1.beginElement();
     }
}

function setClose(Id){
      var animation = document.getElementById('openblank'+Id);
      if(animation!=null) {	
	animation.setAttributeNS(null, 'values','0');
	animation.beginElement();
     }
	 var animation1 = document.getElementById('closeblank'+Id);
      if(animation1!=null) {	
	animation1.setAttributeNS(null, 'values','1');
	animation1.beginElement();
     }
}
//初始化所有开关状态（关闭）
