function startAlarmBlink(Id,color){
      var animation = document.getElementById('animate'+Id);
      if(animation!=null) {	
	animation.setAttributeNS(null, 'values',color);
	animation.setAttribute('dur','0.5s');
	animation.beginElement();
     }
}

function deviceIDs(){
	return '1369758,1362693,1349599,1369425,1369270,1369205,1369056,1348638,1369130,1369487,1349799,1362888,1362940,1360658,1351654,1352961,1357333,1354727,1355058,1357281,1359650,1359707,1359766,1359846';
}

//设置标题
function setTitle(title){
	modify('title',title);
}
//加载时间
function loadTime(){
	setDisplayTime();
	setTimeout(loadTime, 1000);
}

//设置显示的监控时间
function setDisplayTime() {
	modify('displayTime',new Date().toLocaleString());
}

