//设置母线显示数据
function setBusValues(ua,ub,uc,ia,ic,ib){
	t = document.getElementById('transformer_status');
	child = t.firstChild;
	child.firstChild.nodeValue = 'ua：' + ua;
	child = child.nextSibling;
	child.firstChild.nodeValue = 'ub：' + ub;
	child = child.nextSibling;
	child.firstChild.nodeValue = 'uc：' + uc;
	child = child.nextSibling;
	child.firstChild.nodeValue = 'ia：' + ia;
	child = child.nextSibling;
	child.firstChild.nodeValue = 'ib：' + ib;
	child = child.nextSibling;
	child.firstChild.nodeValue = 'ic：' + ic;

}

//设置电压显示数据
function setUValues(loadDeviceID,ua,ub,uc){
	modify('deviceID_' + loadDeviceID+'_Ua', 'Ua：'+ua);

	modify('deviceID_'+loadDeviceID+'_Ub', 'Ub：'+ub);

	modify('deviceID_'+loadDeviceID+'_Uc', 'Uc：'+uc);
}

//设置高压侧或变压器电流显示数据
function setBusIValues(loadDeviceID,ia,ib,ic){
	setIValues(loadDeviceID,ia,ib,ic);
}
//设置电流显示数据
function setIValues(loadDeviceID,ia,ib,ic){
	modify('deviceID_' + loadDeviceID+'_Ia', 'Ia：'+ia);
	modify('deviceID_'+loadDeviceID+'_Ib', 'Ib：'+ib);
	modify('deviceID_'+loadDeviceID+'_Ic', 'Ic：'+ic);
}


/* 以下是SVG文件的内部JS方法 */

//用来修改结点的值
function modify(nodeID,value){
	var e=document.getElementById(nodeID);
	if(e) {
		e.firstChild.nodeValue=value;
	}
}


function buttonClick(evt){
	parentWindow.capacityThrow();
}

function showDevice(param) {
	if((typeof(parentWindow.showDevice)) != 'undefined') {
		parentWindow.showDevice(param);
	}
}
